def GendWeb():
    """ Obtaind name of 'genealog.cl' """

    """ Site with latency to make scraping. """

    # TODO: Add notification logs.
    # Obtaind name of 'genealog.cl' ""
    data: dict = dict()

    # FIXME: Don't get surnames from the letters B onwards
    for letter in LETTERS:
        names_obtained: list = list()
        url: str = f"https://www.genealog.cl/Chile/{letter}.html"
        page: dict = get(url)
        if page.status_code == 200:
            html_soup: dict = BeautifulSoup(page.content, 'html.parser')
            # Get DOM of page.
            dom: dict = etree.HTML(str(html_soup))
            try:
                tags_obtained: list = dom.xpath(
                    "//html/body/font[3]/p[1]/font/a")
                for tag in tags_obtained:
                    names_obtained.append(tag.text)

                data[letter] = names_obtained
            except AttributeError:
                print('ERROR: ', AttributeError)

    JSONFile(data, 'gene')


if __name__ == "__main__":
    Gene()

